package in.dream.ejb.external;

public class Rainfall {
    private String type;
    private String range;
    private String aws_station_count;


    public String getType() {
        return type;
    }

    public void setType(String type) {
        this.type = type;
    }

    public String getRange() {
        return range;
    }

    public void setRange(String range) {
        this.range = range;
    }

    public String getAws_station_count() {
        return aws_station_count;
    }

    public void setAws_station_count(String aws_station_count) {
        this.aws_station_count = aws_station_count;
    }
}
